import axios from "axios";
import React, { useEffect, useState } from "react";
import Dog from "../models/dog";

export function IndexPage() {

    const [dogs, setDogs] = useState<Dog[]>([])

    useEffect(() => {
        fetchDogSearchResults();
    }, []);

    const fetchDogSearchResults = () => {
        const headers = { 'x-api-key': 'ecd04f9a-fb4c-4fb2-b079-de2aaae47e5f' };
        fetch(`https://api.thedogapi.com/v1/images/search?limit=25&page=${1}&order=Desc`, { headers })
            .then(response => response.json())
            .then((data: Dog[]) => {
                setDogs([...dogs, ...[data]])
            })
            .catch(error => {
                //this.setState({ errorMessage: error.message });
                console.error('There was an error!', error);
            });
    }

    return (
        <div>
            <h1>Hello, world!</h1>
            <h2>It is {this.state.dogs}.</h2>
        </div>
    );
}
